import React, { Component } from 'react';
import Card from 'react-bootstrap/Card';



class AdvisorInfo extends Component {
    constructor(props) {
        super(props);
        this.state = {
            advisors: []
        }
    }
    render() { 
        var advisor = {AdvisorID: 0, firstName: "Bob", lastName: "Smith", office: "ERB001"};
        this.state.advisors.push(advisor);
        let advisorlist=this.state.advisors.map((advisor, i)=> {
            return (
                <div>
                    <li>Advisor {i}</li>
                    <li key={i}> Name: {advisor.firstName} {advisor.lastName}</li>
                    <li>Office: {advisor.office}</li>
                    <hr></hr>                    
                </div>
            );
        });
        return (
            <Card border="primary">
                <Card.Header>Advisor Information</Card.Header>
                <Card.Body>
                    <Card.Text>
                        <ul>
                            {advisorlist}
                            {this.state.advisors.map((advisor, i)=> {
                                return(
                                    <div>
                                        <li key={i}> Name: {advisor.firstName} {advisor.lastName}</li>
                                        <li>Office: {advisor.office}</li>   
                                    </div>                                
                                );
                            })}
                        </ul>                     
                    </Card.Text>
                </Card.Body>
            </Card>
        );
    }
}

export default AdvisorInfo;
